import React from 'react'
import { Customer } from './Customer'

//---
export default function DemoModelComponent() {
    //----
    let objCust=new Customer("XYZ","LMN","Male","xyz@gmail.com")
    let message="Fucntional Comps using model class is a best coding pracctice"
  return (
    <>
     <div>
        <h1>Functional Componenet in RJS</h1>
        <h4>{message}</h4>
        <p>FirstName - {objCust.firstName}</p>
        <p>LastName - {objCust.lastName}</p>
        <p>Gender - {objCust.gender}</p>
        <p>Email - {objCust.email}</p>
    </div>

    </>
  )
}
